import { logout } from "../../actions/auth";
import React from 'react'
import { useHistory } from "react-router-dom";
import { useDispatch } from "react-redux";

const Logout = () => {
    let history = useHistory();
    const dispatch = useDispatch();

    dispatch(logout())
    .then(() => {
        history.push("/login");
    });
    return (
        <div>
            You are logged out!
        </div>
    )
}

export default Logout
